package top.tobing.algorithm.back_track.mianshi08_12;

import java.util.ArrayList;
import java.util.List;

/**
 * @author tobing
 * @date 2021/8/29 15:49
 * @description
 */
public class Solution {

    /**
     * used[i]列是否存在元素
     */
    private boolean[] used;
    /**
     * 左下->右上 对角线的列是否存在元素
     * i-j+n-1
     */
    private boolean[] diagonal1;
    /**
     * 左上->右下 对角线的列是否存在元素
     * i+j
     */
    private boolean[] diagonal2;

    /**
     * 第i行的皇后所在列
     */
    private int[] res;

    /**
     * 储存结构
     */
    private List<List<String>> queens;

    /**
     * 【回溯法】
     * 1、合法性辅助变量，帮助判断放置皇后的位置是否合法：
     * 1.1、     {@link Solution#used}
     * 1.2、     {@link Solution#diagonal1}
     * 1.3、     {@link Solution#diagonal2}
     * 2、结果辅助变量，存放皇后的位置
     * 2.1、     {@link Solution#res}
     * 2.2、     {@link Solution#queens}
     * 3、初始化函数{@link Solution#solveNQueens(int)}，辅助将以上需要的辅助变量初始化，并调用主逻辑函数进行执行
     * 3.1、     初始化变量
     * 3.2、     调用主逻辑函数计算n皇后问题
     * 4、主逻辑函数{@link Solution#helper(int, int)}，使用回溯法计算皇后在第index行的位置
     * 4.1、     递归终止条件：当index=n，即已经将所有行的皇后运算出来，直接调用{@link Solution#generateString()}根据{@link Solution#res} 生成n皇后的字符串
     * 4.2、     for循环中，尝试在[0,n-1]的列下放第index行的皇后，放完之后进行标记（更新合法性辅助变量）
     * 4.3、     继续寻找第index+1行的皇后，寻找完毕之后，需要将之前的标记进行回溯（还原合法性辅助变量）
     * <img src="data:image/png;base64,"/>
     */
    public List<List<String>> solveNQueens(int n) {
        // 初始化所有辅助变量
        used = new boolean[n];
        diagonal1 = new boolean[2 * n - 1];
        diagonal2 = new boolean[2 * n - 1];
        res = new int[n];
        queens = new ArrayList<>();
        // 调用主逻辑方法计算皇后位置
        helper(n, 0);
        return queens;
    }

    /**
     * 求解第index行皇后的位置
     */
    private void helper(int n, int index) {
        if (index == n) {
            // 找到符合条件的八皇后、生成字符串返回
            queens.add(generateString());
            return;
        }

        // 尝试在第i列和放置第index行的皇后
        for (int i = 0; i < n; i++) {
            if (!used[i] && !diagonal2[i + index] && !diagonal1[i - index + n - 1]) {
                // 标记已经访问过
                used[i] = true;
                diagonal2[i + index] = true;
                diagonal1[i - index + n - 1] = true;
                res[index] = i;
                // 在选择了当前位置作为index行皇后的基础上，寻找第index+1行皇后的位置
                helper(n, index + 1);
                // 将访问的痕迹清除，进行回溯
                used[i] = false;
                diagonal2[i + index] = false;
                diagonal1[i - index + n - 1] = false;
            }
        }
    }

    /**
     * 根据res生成对应的字符串
     */
    private List<String> generateString() {
        List<String> strings = new ArrayList<>();
        for (int i = 0; i < used.length; i++) {
            StringBuilder sb = new StringBuilder();
            for (int j = 0; j < used.length; j++) {
                // TODO 提交leetcode是将空格去掉，此处添加空格是为了好看
                sb.append(res[i] == j ? "Q " : ". ");
            }
            strings.add(sb.toString());
        }
        return strings;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        List<List<String>> lists = solution.solveNQueens(4);
        for (List<String> list : lists) {
            for (String s : list) {
                System.out.println(s);
            }
            System.out.println();
        }
    }
}
